      <a
        href="http://collinsnick.com/"
        target="_blank"
        rel="noopener noreferrer"
      >
        {` Collins Nixon`}
      </a>
      , click
      <a
        href="https://github.com/collinsNick/React-redux-shopping-web-app"
        target="_blank"
        rel="noopener noreferrer"
      >
        {` Here `}
      </a>
      to get the source code
    </div>
  );
};

export default GitLink;
